import { Component } from "react";
import React from "react";
import { PageMain } from "core";
import NotificationSystem from "react-notification-system";
import BillingListSection from '../../sections/billingListSection'
import { GetUrl } from "../../utils/generals";
import { Backward } from "../../utils/generals";

export default class PersonBillingListPage extends Component
{
    constructor(props)
    {
        super(props);

        this.state = { isLoading: false };

        this.notificationSystem = React.createRef();

        this.requestId = this.props.match.params.requestId;
    }

    // Events.
    render()
    {
        return (
            <>
                <PageMain context={ this } title="دریافت صورتحساب شخص" icon="list-search" isLoading={ this.state.isLoading } footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
                    topButtons={[
                        {
                            title: "لیست درخواست صورتحساب",
                            url: GetUrl("requestBillingListPage"),
                            color: "outline-primary",
                            icon: "list-search",
                        }
                    ]}>
                    <div className="card">
                        <div className="card-body">
                            <BillingListSection notificationSystem={ this.notificationSystem } identifierCode={ this.requestId }
                                url="/api/amls/PersonBilling/SearchPersonBillings" title="جزئیات دریافت صورتحساب شخص"/>
                        </div>
                        <div className="card-footer">
                            <div className="d-flex">
                                <a className="btn btn-outline-secendery ms-auto" onClick={ (e) => Backward(e) } href="/" title="بازگشت به صفحه قبل">
                                    بازگشت
                                <i className="ti ti-arrow-left ms-1"></i>
                                </a>
                            </div>
                        </div>
                    </div>
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        );
    }
}
